export const existingCountry = (poppedCountry, countryToAdd) => {
	console.log(
		poppedCountry[0].name,
		countryToAdd.name,
		poppedCountry[0].name === countryToAdd.name
	);
	return poppedCountry.name === countryToAdd.name ? [] : [countryToAdd];
};
